import React from 'react'
import {
  Form,
  FormGroup,
  Label,
  Input,
  FormFeedback,
  FormText
} from 'reactstrap'

export const Register = () => {
  const registerUser = () => {
    const username = document.getElementById('registerUsername').value
    const password = document.getElementById('registerPassword').value
    const rPassword = document.getElementById('registerRPassword').value

    //console.log(email, password, rPassword);

    if (password === rPassword) {
      let body = {
        username: username,
        password: password
      }

      fetch('http://localhost:4000/api/v1/user/register', {
        method: 'POST',
        body: JSON.stringify(body),
        headers: {
          'Content-Type': 'application/json'
        }
      })
        .then(json => {
          if (json.status == 200) {
            return json.json()
          } else {
            alert('REGISTRATION: failed')
          }
        })
        .then(response => {
          if (response) {
            alert('REGISTRATION: success')
            // window.location.href = "/login";
          }
        })
        .catch(e => {
          console.log(e)
        })
    } else {
      alert('REGISTRATION: Password does not match')
    }
  }

  return (
    <Form>
      <FormGroup>
        <Label for='exampleEmail'>Register new User</Label>
        <Input plaintext value='Some plain text/ static value' />
      </FormGroup>
      <FormGroup>
        <Label for='exampleEmail'>Username</Label>
        <Input
          type='username'
          name='username'
          id='exampleUsername'
          placeholder='Enter Username'
        />
      </FormGroup>
      <FormGroup>
        <Label for='examplePassword'>Password</Label>
        <Input
          type='password'
          name='password'
          id='examplePassword'
          placeholder='Enter Password'
        />
      </FormGroup>
      <FormGroup>
        <Label for='exampleRPassword'>Repeat your Password</Label>
        <Input
          type='Rpassword'
          name='Rpassword'
          id='exampleRPassword'
          placeholder='Repeat Password'
        />
      </FormGroup>
    </Form>
  )
}
